      <EleDiv_b onClick={onEle}>
        <BroImgDiv>
          <GridImage src={img}></GridImage>
        </BroImgDiv>
        <BroContentDiv>
          <ImageHead_s>{header}</ImageHead_s>
          <ImageSummary>{text}</ImageSummary>
          <Price>{price}</Price>
        </BroContentDiv>
      </EleDiv_b>
    )
  }
